import React from "react";
import Layout from "../../components/layout";
import styles from "./style.module.css";

const SettingsPage = () => {
  return (
    <Layout>
      <div className={styles.Settings}>
        <span>AYARLAR</span>

        <div className={styles.ProfileSettingsBox}>
          <div className={styles.ProfileSettings}>Profili Düzenle</div>

          <div className={styles.ImageChange}>
            {" "}
            <img src="" alt="" /> <span>Değiştir</span>{" "}
          </div>

          <div className={styles.userNameChange}>
            {" "}
            <span>Kullanıcı adını değiştir</span> <input type="text" />{" "}
          </div>
        </div>

        <div className={styles.personalInformationChangeBox}>
          <div className={styles.ChangeMail}>
            <span>Mail adresini değiştir</span> <input type="text" />{" "}
          </div>
          <div className={styles.ChangeMail}>
            <span>Şifreyi değiştir </span> <input type="text" />{" "}
          </div>
        </div>

        <div className={styles.turnOffNotfications}></div>

        <button className={styles.saveChange}>KAYDET</button>
      </div>
    </Layout>
  );
};

export default SettingsPage;
